import React, { Component } from 'react';
import axios from 'axios';
import BlogList from './BlogList';

class Blog extends Component{
    state = {"listData" : [{
        "title" : "test" ,
        "contents" : "test",
        "create_date" : "2019-06-10"
    }]
    }

    async componentDidMount() {
        let listData;
        listData = await axios.get("http://localhost:8080/");
        console.log(listData);
        this.setState({
            listData : listData
        })
        console.log("data : ");
        console.log(this.listData);
        console.log(this.state.listData);
        console.log("data : 11");
    }

    handleClick = () => {
        console.log("click!")
    }

    render() {
        return (
            <div>
                <BlogList onClick={this.handleClick}
                        info={this.listData}/>
            </div>
        )
    }
}

export default Blog;
